import React from 'react'
import { View, Text,StyleSheet } from 'react-native'

const NavBar = () => {
    return (
        <View style={styles.container}>
            <View style={styles.head}>
                <Text>Head</Text>
            </View>
            <Text>nav</Text>
        </View>
    )
}

const styles = StyleSheet.create({
    container:{
        flex:1,
        alignItems:'center',
    },
    head:{
        padding:20,
        backgroundColor:'#00B8FA',
    },
})
export default NavBar
